import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";
import heroBg from "../images/hero-bg.jpg";

const PartnershipSearch = () => {
  const navigate = useNavigate();
  const { user } = useAuth();
  const [searchParams, setSearchParams] = useState({
    location: "",
    orgType: "",
    partnershipGoal: "",
  });

  const handleSearch = (e) => {
    e.preventDefault();
    // 处理搜索逻辑
    console.log("Search params:", searchParams);
  };

  return (
    <div className="min-h-screen relative">
      {/* 背景图片 */}
      <div
        className="absolute inset-0 z-0"
        style={{
          backgroundImage: `linear-gradient(to bottom, rgba(0, 128, 128, 0.3), rgba(0, 128, 128, 0.5)), url(${heroBg})`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          filter: "saturate(0.8) brightness(0.9)",
        }}
      />

      {/* 返回按钮 */}
      <button
        onClick={() => navigate(user ? "/home" : "/")}
        className="absolute top-8 left-8 z-10 text-white hover:text-gray-200 transition-colors duration-200"
      >
        <svg
          className="w-8 h-8"
          fill="none"
          stroke="currentColor"
          viewBox="0 0 24 24"
        >
          <path
            strokeLinecap="round"
            strokeLinejoin="round"
            strokeWidth="2"
            d="M10 19l-7-7m0 0l7-7m-7 7h18"
          />
        </svg>
      </button>

      {/* 主要内容 */}
      <div className="relative z-10 flex flex-col items-center justify-center min-h-screen px-4">
        <h1 className="text-5xl font-bold text-white mb-12 tracking-tight">
          Let's Find Your Perfect Partner
        </h1>

        <div className="w-full max-w-3xl bg-white/90 backdrop-blur-md rounded-2xl shadow-xl p-8">
          <form onSubmit={handleSearch} className="space-y-6">
            {/* Location */}
            <div>
              <label
                htmlFor="location"
                className="block text-sm font-medium text-gray-700 mb-2"
              >
                Location
              </label>
              <input
                type="text"
                id="location"
                className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition-all duration-200"
                placeholder="Enter city or region"
                value={searchParams.location}
                onChange={(e) =>
                  setSearchParams({ ...searchParams, location: e.target.value })
                }
              />
            </div>

            {/* Organization Type */}
            <div>
              <label
                htmlFor="orgType"
                className="block text-sm font-medium text-gray-700 mb-2"
              >
                Organization Type
              </label>
              <select
                id="orgType"
                className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition-all duration-200"
                value={searchParams.orgType}
                onChange={(e) =>
                  setSearchParams({ ...searchParams, orgType: e.target.value })
                }
              >
                <option value="">Select organization type</option>
                <option value="nonprofit">Nonprofit</option>
                <option value="forprofit">For-Profit</option>
                <option value="social">Social Enterprise</option>
                <option value="government">Government</option>
              </select>
            </div>

            {/* Partnership Goal */}
            <div>
              <label
                htmlFor="partnershipGoal"
                className="block text-sm font-medium text-gray-700 mb-2"
              >
                What Kind of Organization Are You Looking For?
              </label>
              <textarea
                id="partnershipGoal"
                rows="4"
                className="w-full px-4 py-3 rounded-xl border border-gray-200 focus:ring-2 focus:ring-teal-500 focus:border-transparent transition-all duration-200"
                placeholder="Describe your ideal partnership and what you hope to achieve..."
                value={searchParams.partnershipGoal}
                onChange={(e) =>
                  setSearchParams({
                    ...searchParams,
                    partnershipGoal: e.target.value,
                  })
                }
              />
            </div>

            {/* Search Button */}
            <button
              type="submit"
              className="w-full bg-teal-600 text-white py-4 px-6 rounded-xl hover:bg-teal-700 transition-colors duration-200 font-medium text-lg"
            >
              Search Partners
            </button>
          </form>
        </div>
      </div>
    </div>
  );
};

export default PartnershipSearch;
